import React from 'react'
import "./Mission.css";
import visionIcon from "./analytics-outline.svg";
import misionIcon from "./bulb-outline.svg";
import packageIcon from "./cube-outline.svg";
import ProductIcon from "./disc-outline.svg";
import LogisticIcon from "./flask-outline.svg";



function Mission() {
  return (
    <div className='mission-dom-container'>
      <div className='mission-upper-container'>
        <div className='vision-container'>
          <div className='vision-icon-container'><img></img></div>
          <div className='vision-text-container'><p></p></div>
        </div>
        <div className='mission-container'>
          <div className='mission-icon-container'><img></img></div>
          <div className='mission-text-container'><p></p></div>
        </div>
      </div>

      <div className='mission-bottom-container'>
        <div className='detail1-container'></div>
        <div className='detail2-container'></div>
        <div className='detail3-container'></div>
      </div>
    </div>
  )
}

export default Mission
